INSERT INTO `family` VALUES (9974, '永外大街160号', NULL, NULL, NULL, '1', 20.40, NULL, '', NULL, 0, NULL, NULL, NULL, 0, NULL, 0, 'BH-1-5-25', NULL, 1, NULL, '5', 0, 0, '', NULL, NULL, 1.00, 2, 3, 4, 4, '110103195812241858', 1, NULL, NULL, NULL, 1, NULL, 0, NULL, 0, 1, 0, NULL, NULL, 0, '林顺来（已故）等三人共有', NULL, NULL, 0, NULL, NULL, NULL, 1, '3月15日销“？”。调查组：此房产权为林顺来、林淑英、林淑毅三人共有，各占三分之一份额。林淑英共有权证号：京房权证崇私字第00928号，林淑毅共有权证号：京房权证崇私字第00929号。林顺来、林淑英已故。此房目前由林顺成长期居住（林顺成为林世德儿子，与林顺来为堂兄弟），在房屋析产时有矛盾，被林顺成长年占用。', 1, '13681202699', NULL, 0.00, NULL, 0, 0.00, 0.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
